import React from 'react'
import { Container, MessageContainer } from './chat-window.styles'

const ChatWindow = ({ messages }) => (
  <Container>
    {!messages
      ? null
      : messages.map((message) => (
          <MessageContainer>{message}</MessageContainer>
        ))}
  </Container>
)

export default ChatWindow
